    render(){

        return(
            <Container isEqualWidth="100%" isEqualHeight="100vh" justifyContent="center" alignItems="center" backgroundColor="#EDEDED">
                <View width="40%" height="40vh" backgroundColor="#fff">
                    <Text>Content</Text>
                </View>
            </Container>
        )
    }
}


export default Dashboard
